import React, {PureComponent} from 'react'
import './filter.scss';

export default class Filter extends PureComponent {

  handleChange = (event) => {
    alert('A name was submitted');
  };


  render(){
    return (
      <div className="fiter">
        <label><div>Новинки <input onChange={this.handleChange} type="checkbox"/></div></label>
        <label><div>Акции <input type="checkbox"/></div></label>
        <label><div>Популярные <input type="checkbox"/></div></label>
        <label><div>По цене <input type="checkbox"/></div></label>
      </div>
    )
  }
}
